/*SQL_ID: com-sds-healthcare-ehrdw-dao-DwzQuryInqrDAO-pagingDwzQuryInqrColumn01 */
select  
        RNUM
     ,  CLMN_NM_01
  from  (
        select  ROWNUM                  as RNUM
             ,  substrb(CLMN_NM_01, 1, 200) as CLMN_NM_01
          from  ( ${quryCtn}
                ) a1
        ) a2
where  RNUM  >  cast(coalesce(#{nextKeyValue}, '0') as number)              
  and  RNUM  <= cast(coalesce(#{nextKeyValue}, '0') as number) + #{pageSize}

